import React, { useState } from 'react';
import './styles.css';

function AddVolunteerPoints() {
  const [formData, setFormData] = useState({
    memberNumber: '',
    firstName: '',
    lastName: '',
    team: '',
    date: '',
    activity: '',
    hours: '',
    points: '',
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Submit the form data to your backend here
  };

  return (
    <div className="form-container">
      <h2>Add Volunteer Points</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="memberNumber"
          placeholder="Member Number"
          value={formData.memberNumber}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="firstName"
          placeholder="First Name"
          value={formData.firstName}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="lastName"
          placeholder="Last Name"
          value={formData.lastName}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="team"
          placeholder="Team"
          value={formData.team}
          onChange={handleChange}
          required
        />
        <input
          type="date"
          name="date"
          value={formData.date}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="activity"
          placeholder="Activity"
          value={formData.activity}
          onChange={handleChange}
          required
        />
        <input
          type="number"
          name="hours"
          placeholder="Hours"
          value={formData.hours}
          onChange={handleChange}
          required
        />
        <input
          type="number"
          name="points"
          placeholder="Points"
          value={formData.points}
          onChange={handleChange}
          required
        />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default AddVolunteerPoints;
